/*  CSS Vycentrovanie a velkost banneru  */

#exponea-form {
	width: 100%;
    height: 100%;
}

.form-wrapper {
	height:100%;
}

.exponea-subscription-dialog {
  position: fixed;
  margin-left: 0px;
  margin-top: 0px;
  z-index: 9999999;
  font-family: "NimbusSan", Arial, Sans-serif;
  text-align: center;
  line-height: normal;
  text-decoration: inherit;
  cursor: default;
  display: none;
}

.exponea-subscription-dialog,
.exponea-subscription-dialog * {
  box-sizing: border-box;
  /*The box-sizing property defines how the width and height of an element are calculated: should they include padding and borders, or not.*/
}

.exponea-subscription-dialog:hover,
.exponea-subscription-dialog:active {
  text-decoration: inherit;
  /* overline, line-through, underline, inherit */
}

.exponea-subscription-dialog span {
  display: block;
}


/* CSS backdrop banneru */

.exponea-banner-backdrop {
  z-index: 999998;
  position: fixed;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  background-color: white;
  opacity:  0.8;
  display: block;
}

/* CSS zatvorenie */

.exponea-subscription-dialog .exponea-close .exponea-close-cross {
  position: absolute;
  display: inline-block;
  overflow: hidden;
}

.exponea-subscription-dialog .exponea-close:hover {
  cursor: pointer;
}

.exponea-subscription-dialog .exponea-close .exponea-close-cross:before,
.exponea-subscription-dialog .exponea-close .exponea-close-cross:after {
  content: '';
  position: absolute;
  height: 2px;
  width: 100%;
  top: 50%;
  left: 0;
  margin-top: -1px;
  height: 1px;
  background: white;
  height: 1px;
  display: block;
}

.exponea-subscription-dialog .exponea-close .exponea-close-cross:before {
  -webkit-transform: rotate(45deg);
  transform: rotate(45deg);
}

.exponea-subscription-dialog .exponea-close .exponea-close-cross:after {
  -webkit-transform: rotate(45deg);
  transform: rotate(-45deg);
}


/* CSS PODMIENKY */
.suhlas {
  display: none;
  z-index: 99999999;
  height: 90%;
  width: 100%;
  background: #333;
  position: absolute;
